mapper.select:
    select t1.*
    from lt_ad_google_adwords_report_campaign t1, lt_google_adwords_campaign t2
    where t1.campaign_id = t2.id
	and t1.is_charged = 0
	and t1.date = #{date}
	and t2.lt_ad_campaign_id = #{adCampaignId}

update.foreach:
update lt_ad_google_adwords_report_campaign
set markup_type = #{item.markupType},
markup_amount = #{item.markupAmount},
charge_amount = #{item.chargeAmount},
is_charged = #{item.isCharged}
where id = #{item.id}

mapper.update:
update lt_ad_google_adwords_report_campaign
set markup_type = #{markupType},
markup_amount = #{markupAmount},
charge_amount = #{chargeAmount},
is_charged = #{isCharged}
where id = #{id}
